import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { Container } from './styles';
import Home from './compositions/home';
import Portals from './compositions/portals';
import Contact from './compositions/contact';
import Navigation from './components/navigation';
import Button from './components/button';
import External from './components/icons/external';
import styled from '@emotion/styled';


const StyledLink = styled(Link)(() => ({
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  background: 'transparent',
  border: '1px solid transparent',
  borderRadius: 4,
  margin: 0,
  textDecoration: 'none',
  '-webkit-font-smoothing': 'antialiased',
  '-moz-osx-font-smoothing': 'grayscale',
  fontFamily:  'Inter, sans-serif',
  lineHeight: 1,
  cursor: 'pointer',
  padding: '12px 16px',
  gap: 14,
}));

function App() {

  return (
    <Router>
      <Container>

        <Navigation localStyles={{position: 'fixed', top: 0}}>
          <StyledLink to="/">Home</StyledLink>
          <StyledLink to="/portals">Portals</StyledLink>
          <StyledLink to="/contact">Contact</StyledLink>
          <Button as="a" variant='TERTIARY' size='M' after={<External />} href='https://payc.auraexchange.org/' target="_blank">Marketplace</Button>
          <Button as="a" variant='TERTIARY' size='M' after={<External />} href='https://payc.engagertool.app/' target="_blank">EngageR</Button>
        </Navigation>

        <Routes>
          <Route path="/portals" element={<Portals />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/" element={<Home />} />
        </Routes>
      </Container>
    </Router>

  );
}

export default App;
